import { useSelector } from 'react-redux';

const BatteryDetailsPanel = () => {
    const estimator = useSelector((state:any) => state.battery);
    return (
        <>
        {"Battery Details Panel:- "}
        {"Battery Type:- "+ estimator}
        </>
    );
}

export default BatteryDetailsPanel;
